import React from 'react';

function Index(props) {
    return (
        <div>
            <nav>
                <ul>
                    <li><a href="/"> Home </a></li>
                    <li><a href="/about"> About </a></li>
                    <li><a href="/contact"> Contact </a></li>
                </ul>
            </nav>
            Home Page
        </div>
    );
}

export default Index;
